【仕様】<br>
LED ミニレフ電球 (レフ球タイプ)<br>
口金：E17<BR>
サイズ：50x80 (mm)<br>
定格電圧(周波数)：AC100V(50/60Hz)<br>
消費電力:5.5W<br>
色温度：電球色 2700K/昼白色 5000K<br>
全光束：電球色 450lm/昼白色 480lm (※一般白熱電球55W相当)<br>
平均演色性評価数：Ra80<br>
照射角度：100°<br>
質量：55g<br>
高品質、省エネ<br>
1年間製品保証<br>
定格寿命40,000時間以上<br><br>

※調光器非対応<br><br>

関連タグ：【レフランプ形】 【LED照明】 【LED電球　e17】 【E17 LED電球 ミニレフ形】 【ミニレフ led】 【レフ球 led】 【レフ電球タイプ】 【ledランプ】 【ledライト】<br><br>











